import React from 'react';

const HomePage = () => {
  return (
    <div>
      <h1>SeoulTech Chat</h1>
      <p>서울과학기술대학교 채팅 시스템에 오신 것을 환영합니다!</p>
    </div>
  );
};

export default HomePage;
